import styled from "styled-components";

const EditorStyles = styled.div`
  .editor__wrap {
    margin: 10px;
    border: 1px solid;
    border-radius: 4px;
  }

  #tab-panel {
    padding-top: 10px;
    span {
      display: inline-block;
      margin: 10px;
      transform: scale(1.5);
    }
  }

  #tab-toolbar {
    display: flex;
    justify-content: space-evenly;
    li {
      margin: 0;
    }
  }
`;
export default EditorStyles;
